    scriptUrl: '//at.alicdn.com/t/font_1670298_zifga8qyiwd.js',
});

class LocalIconFont extends React.Component{

    render(){
        let {type}=this.props;
        // if(null==type||undefined==type){
        //     type="icon-set"
